import React from "react";
import './MyPosts.css'

function MyPosts() {
    return(
            <div>
                My posts
                <div>
                    New posts
                </div>
                <div>
                    <div>Post1</div>
                    <div>Post2</div>
                </div>
            </div>
    )
}
export default MyPosts;
